window.bookSummaryJSON = "<p><b>From </b><b><i>New York Times</i></b><b> bestselling author Craig Alanson comes book three in the Convergence series, melding action-packed urban fantasy with his signature humor. Read by none other than award-winning narrator R.C. Bray.</b></p> <p>Kaz Wolfe is trying to prevent ancient gods from regaining access to our world. The Order wants to open a portal to the Nether to gain power by serving those gods. Playing defense isn’t working. The Order always has the initiative. It’s time for direct action, to hit the Order hard.</p> <p>Before it’s too late for us.</p>"; 
